EAScenario.description:
2.1 Visualizar Dados Funcionário
<b>Visualizar Dados Funcionário.</b>
1- O Sistema acessa o <b>Funcionários</b> relacionado ao <b>DadoPessoal</b> escolhido; 
2- O Sistema mostra os dados: "<b>Matrícula Estado, Matrícula Órgão, Concurso, Contrato, Data Apresentação, Id(</b>Como<b> </b>matrícula<b> </b>Provisória<b>) e Situação";</b>
3- O Sistema permite opção de <b>"Detalhar Situação Funcional" </b>do funcionário em destaque;  
4- O Sistema permite opção de <b>"Listar Documento Funcional" </b>do funcionário em destaque;  
<b>Fim
