properties.documentation:
Manter o registro dos benefícios oficiais oferecidos na Empresa. Os benefícios seguem regras próprias a serem avaliadas posteriormente.
Estes registros servem de apoio ao cadastro de Beneficiários, que devem obrigatoriamente ser cadastrados com pelo menos um beneficio.
Ex:Plano de Saúde;Pecúlio;Vale Transporte;Auxílio Creche;etc.

<b><u>-Classe:</u></b>
BENEFÍCIO

<b><u>-Atributo:</u></b>
Descrição - Nome do Benefício;
Setor Responsável - Setor responsável pelo gerenciamento do Beneficio; 
Início Vigência - Início da vigência do Benefício;
Fim Vigência - Fim da vigência do Benefício;
Situação - "Ativa" ou "Inativa";

documentation.value:
O nome do Setor responsável pelo encaminhamento do benefício:
1- Nome do Órgão;
2- Nome  da Associação;
3- Outros

properties.documentation:
Está classe representa os dados curriculares do empregado.

Foram retirados os atributos Objetivo(Programa/Grade) e Peso;
Devem ser reconsiderados num foco gerencial de CURSO &lt;= peso=&gt; CARGO

